		"text": "\"1일 경찰과 유통업계에 따르면 아워홈에 근무하던 직원 A씨는 여직원들 신체부위를 촬영하기 위해 본사 여자화장실에 몰카를 설치했다. 이후 지난달 3일 화장실을 이용한 여직원이 몰카를 발견하고 회사에 알렸다.\"",
